//become a booster page that is executed after becomeabooster button is pressed
// Language: javascript
// Path: src\components\BecomeABooster.jsx
// Compare this snippet from src\components\Header.jsx:

import React from 'react';

class BecomeABooster extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            isLoggedIn: false
        }
    }

    render() {
        return (
            <div className="becomeabooster">
                <div className="becomeabooster-title">
                    <h1>Become a Booster</h1>
                </div>
                <div className="becomeabooster-form">
                    <form>
                        <div className="becomeabooster-form-title">
                            <h2>Personal Information</h2>
                        </div>
                        <div className="becomeabooster-form-name">
                            <label>Name</label>
                            <input type="text" placeholder="Enter your name" />
                        </div>
                    </form>
                </div>
            </div>
        );
    }
}

export default BecomeABooster;
